import React from "react";

const Contact = () => {
  return (
    <section id="contact" className="content-section">
      <h1>Contact Me</h1>
      <p>
        My phone number is <b>408-912-6510</b>. You can email me at <b>darshgangakhedkar [at] gmail [.] com</b>.
      </p>
    </section>
  );
};

export default Contact;
